import React from "react";

import Login from "../views/login";
import CadastroUsuario from "../views/cadastroUsuario"

import { Route, Routes } from "react-router-dom";
import Home from "../views/home";
import CadastroConta from "../views/cadastroConta";
import CadastroCartao from "../views/cadastroCartao";
import ConsultaLancamentos from "../views/lancamentos/consultaLancamentos";
import CadastroLancamento from "../views/lancamentos/cadastroLancamento";

function Rotas(){
    return(
        <Routes>
            <Route path="/" component={Home} />
            <Route path="/login" component={Login} />
            <Route path="/cadastro-usuario" component={CadastroUsuario} />
            <Route path="/cadastro-conta" component={CadastroConta} />
            <Route path="/cadastro-cartao" component={CadastroCartao} />
            <Route path="/consulta-lancamentos" component={ConsultaLancamentos} />
            <Route path="/cadastro-lancamentos" component={CadastroLancamento} />
        </Routes>
    );
}

export default Rotas;
